import React from "react";
import {Carousel} from 'react-bootstrap';
import './CarouselContainer.css';
import 'bootstrap/dist/css/bootstrap.min.css';

 
const CarouselContainer = () => {     
    return( 
        <carousel control={false} fade={true} pause={false}> 
  <Carousel.Item interval={2000}> 
    <img 
      className="d-block w-100"    
      src=" https://c.ndtvimg.com/2018-10/ohqcobr_handi-biryani_625x300_08_October_18.jpg" width="750px" height="500px"
    /> 
    <div class="centered">Delicious quality chicken Biriyani</div>
  </Carousel.Item> 
  <Carousel.Item interval={2000}> 
    <img       
    className="d-block w-100" 
      src="https://curlytales.com/wp-content/uploads/2020/07/Biryani-1-1024x576.jpg "        
    /> 
    <div class="centered">Protien Rich Biriyani</div>
  </Carousel.Item> 
  </carousel> 
    ) }; 
    
    export default CarouselContainer
